use zellij_tile::prelude::*; #[derive(Default)]
struct State; register_plugin!(State); impl ZellijPlugin for State { fn load(&mut self) {} fn update(&mut self, event: Event) {} fn render(&mut self, rows: usize, cols: usize) {}
} When using the zellij-tile library, plugins are written as Structs that implement the ZellijPlugin trait. The magic line here is register_plugin!(State), which wraps up the State struct in a way that neatly exposes its ZellijPlugin implementation for Zellij to find. Note that load(), update(), and render() have default implementations, so you only need to define the callbacks used by your plugin.

