That was pretty easy, so let's try to do something a bit more interesting! Let's subscribe to some Events by adding the following code to load(): fn load(&mut self) { subscribe(&[EventType::ModeUpdate]);
} Code in load() is called once the first time your plugin is loaded. Aside from that, it's nothing special. Anything that you can do in the load() method should be possible from within the update() and render() methods as well. The subscribe() function is part of zellij-tile::prelude and sends a message to Zellij asking to be notified when certain Events occur. In this case, we're subscribing to ModeUpdate events. The documentation for Event tells us that a ModeUpdate contains the ModeInfo struct, which stores the current mode as well as some additional information. To actually handle these events, we'll need to add some code to our update() method: fn update(&mut self, event: Event) { if let Event::ModeUpdate(mode_info) = event { dbg!(mode_info.mode); }
} Here we are checking for ModeUpdates and destructuring them to get the current mode. Currently, the dbg!() macro is being used to dump this information to stderr. If we want to actually see this debug info, we'll need to run our plugin slightly differently: cargo build
# The 2> redirects stderr to dbg.log
zellij -l plugin.yaml 2> dbg.log Do some faffing about in Zellij, changing modes a couple of times, then take a look at dbg.log: [src/main.rs:15] mode_info.mode = Normal
[src/main.rs:15] mode_info.mode = Pane
[src/main.rs:15] mode_info.mode = Tab
[src/main.rs:15] mode_info.mode = Resize
[src/main.rs:15] mode_info.mode = Scroll
[src/main.rs:15] mode_info.mode = Locked
[src/main.rs:15] mode_info.mode = Normal Excellent! It looks like our plugin is receiving mode updates! If you'd like to see these sorts of logs live, try opening a second terminal and running tail -f dbg.log. The next thing to do is properly store a log of events and print them to the screen. Let's start by tweaking our State struct: use std::collections::VecDeque; #[derive(Default)]
struct State { log: VecDeque<String>,
} We've gone with a VecDeque so that we can efficiently push Strings to the front of log and so we can show off how easy it is to use standard library components from within a plugin. Let's change the update() method again to grow our log: fn update(&mut self, event: Event) { if let Event::ModeUpdate(mode_info) = event { let mode = format!("{:?}", mode_info.mode); self.log.push_front(mode); }
} Recall that the {:?} format specifier simply debug-prints a value and that log.push_front(mode) adds a mode String to the front of our log messages. Finally, let's update render() to print out all of our log messages: fn render(&mut self, rows: usize, cols: usize) { for mode in &self.log { println!("Mode: {}", mode); }
} Let's give things a run with cargo build && zellij -l plugin.yaml and test it out! Our Plugin Excellent! You should notice that, as you cycle through different modes in Zellij, that those updates are being logged on-screen. This is a good start, but no logger is complete without storing timestamps! Let's import the chrono crate for working with time. First we'll need to add it to our Cargo.toml: [package]
name = "mode-logger"
version = "0.1.0"
authors = ["Brooks J Rady <b.j.rady@gmail.com>"]
edition = "2018" [dependencies]
zellij-tile = "1.0.0"
chrono = "0.4" Quite a few Rust libraries can compile to WebAssembly without any issue – this is one of them! Let's import it and update State to store timestamps: use chrono::{DateTime,Local}; #[derive(Default)]
struct State { log: VecDeque<(String, DateTime<Local>)>,
} Next we'll need to actually store these timestamps in update(): fn update(&mut self, event: Event) { if let Event::ModeUpdate(mode_info) = event { let mode = format!("{:?}", mode_info.mode); // Local::now() gets the current time and date self.log.push_front((mode, Local::now())); }
} Finally, we can render() the timestamps to the screen: fn render(&mut self, rows: usize, cols: usize) { for (mode, time) in &self.log { println!("Mode: {} ({})", mode, time.format("%T")); }
} The different options for time.format() can be found in the chrono::format::strftime module; %T shows the time in HH:MM:SS format. Finally, let's test this out! Our Plugin It looks like getting the time is working perfectly! Unfortunately, because our different mode names are different lengths, it looks a bit messy at the moment. Luckily, every time that render() is called, it passes the size of plugin pane. Let's use the cols value to right-align the timestamp: fn render(&mut self, _rows: usize, cols: usize) { for (mode, time) in &self.log { let mode = format!("Mode: {}", mode); let time = time.format("%T").to_string(); let padding = " ".repeat(cols - mode.len() - time.len()); println!("{}{}{}", mode, padding, time); }
} By separately storing the left-aligned mode String and the right-aligned timestamp, we can calculate (using cols) exactly how much padding we need to fill the screen. Once we've done that, it's just a matter of printing the left half, the padding, then the right half. If we run this code, we now get the much nicer: Our Plugin Try resizing your terminal window or the plugin pane and watch how things stay properly justified! As a final step, let's add a couple of commands that allow the user to clear their history or save their log to a file. To do this, we'll need our plugin to receive KeyPress events: fn load(&mut self) { subscribe(&[EventType::ModeUpdate, EventType::KeyPress]);
} Now we can expand update() to handle ModeUpdate and KeyPress events. Let's make Ctrl-L the command for clearing the logs: fn update(&mut self, event: Event) { match event { Event::ModeUpdate(mode_info) => { let mode = format!("{:?}", mode_info.mode); self.log.push_front((mode, Local::now())); } Event::KeyPress(Key::Ctrl('l')) => self.log.clear(), _ => (), }
} When matching against KeyPress events, you might find it helpful to explore the zellij_tile::Key enum. Also note that we need the catch-all case _ => () because, even though we've only subscribed to the ModeUpdate and KeyPress events, the Rust compiler on its own can't guarantee that only those events will be passed to update(). Let's try running this, changing modes a couple of times, then pressing Ctrl-L: Our Plugin Incredibly blank! Nicely done! As one final feature, we'll dump a log of the captured events to mode-log.txt when Ctrl-W is pressed: use std::{fs::File, io::Write}; // ... snip ... fn update(&mut self, event: Event) { match event { Event::ModeUpdate(mode_info) => { let mode = format!("{:?}", mode_info.mode); self.log.push_front((mode, Local::now())); } Event::KeyPress(Key::Ctrl('l')) => self.log.clear(), Event::KeyPress(Key::Ctrl('w')) => { if let Ok(mut f) = File::create("mode-log.txt") { for (mode, time) in self.log.iter().rev() { writeln!(f, "{}: Entered {} Mode", time.format("%c"), mode).unwrap(); } } } _ => (), }
} A couple of new things here, but all of them are vanilla Rust – nothing changes when writing a plugin! File::create("mode-log.txt") is just normal code for creating a file named mode-log.txt in the current directory. After the file is created, we're again looping through all of the log events and writing them out (but this time to a file!). The format of the log file is also a bit different from the log we show on-screen. First of all, we're writing things to the log file in chronological order (that's why we're reversing our log with self.log.iter().rev()), and we've also changed to a more verbose timestamp. The %c should look something like this: Tue Apr 20 10:21:02 2021. Let's run Zellij again, change some modes, then press Ctrl-W: Our Plugin We can then look at mode-log.txt, which should look something like this: Tue Apr 20 10:20:40 2021: Entered Normal Mode
Tue Apr 20 10:20:46 2021: Entered Pane Mode
Tue Apr 20 10:20:50 2021: Entered Tab Mode
Tue Apr 20 10:20:53 2021: Entered Resize Mode
Tue Apr 20 10:20:57 2021: Entered Scroll Mode
Tue Apr 20 10:21:00 2021: Entered Locked Mode
Tue Apr 20 10:21:02 2021: Entered Normal Mode And that's all, folks! The full code for this example can be found in the rust-plugin-example repository.

