We'll now start by importing zellzig, and saving the import in a variable called zz: const std = @import("std");
const zz = @import("zellzig"); This won't do much on its own, but now we can call zellzig functions. The first one we should call is one that creates all the exported symbols that zellij will call, alongside some communication handling. This function actually needs to be called at compile time, as all it does is give the compiler some functions to be exported by the wasm file. Because of this, It goes in a comptime block. const std = @import("std");
const zz = @import("zellzig"); comptime { zz.createPlugin(@This());
} We pass in @This(), which is the struct of the current scope. Since namespaces in zig are just structs, this return our root struct. createPlugin needs this, so it can get access to the functions we'll define next. There are 3 functions that zellzig calls: init called on plugin initialization update called on an event render called to draw the plugin

