In the init function, we should set zellzig's allocator, which it uses for deseralization of zellij's messages. var gpa = std.heap.GeneralPurposeAllocator(.{}){}; pub fn init() void { zz.allocator = gpa.allocator();
} Here, we create a GeneralPurposeAllocator. It's assigned to a global variable, so it's not dropped once init returns. Then, we assign the allocator to zz.allocator. Now the allocator is set. Next, we'll make sure zellij doesnt stay open because of our plugin. To do this, we'll make our plugin unselectable: zz.api.setSelectable(false); The last thing we'll put in init is a call to subscribe. This tells zellij what events we're interested in: zz.api.subscribe(&[_]zz.types.EventType{.ModeUpdate}) catch unreachable; The subscribe function takes a slice of EventTypes we want to receive. Since we're making a status bar, we only care about mode updates, but you can add more if you wish. This function can return an error, since sending data to zellij might fail. But since we can't recover from it, we'll use catch unreachable, so the program crashes if this fails. Our code should now look like this: const std = @import("std");
const zz = @import("zellzig"); comptime { zz.createPlugin(@This());
} var gpa = std.heap.GeneralPurposeAllocator(.{}){}; pub fn init() void { zz.allocator = gpa.allocator(); zz.api.setSelectable(false); zz.api.subscribe(&[_]zz.types.EventType{.ModeUpdate}) catch unreachable;
}

