render is the last function we need. In it, we display the current mode (which we saved in mode, remember?). pub fn render(rows: i32, cols: i32) void { _ = rows; _ = cols; if (mode) |m| { var out = std.io.getStdOut(); var writer = out.writer(); writer.writeAll(@tagName(m)) catch {}; }
} We assign rows and cols to _, since we don't need them. Next we check if mode is set, and if it is, we print it out. @tagName returns the string name of an enum variable. With the last function in place, our plugin should be all done. This is what the finished code looks like: const std = @import("std");
const zz = @import("zellzig"); comptime { zz.createPlugin(@This());
} var gpa = std.heap.GeneralPurposeAllocator(.{}){};
var mode: ?zz.types.InputMode = null; pub fn init() void { zz.allocator = gpa.allocator(); zz.api.setSelectable(false); zz.api.subscribe(&[_]zz.types.EventType{.ModeUpdate}) catch unreachable;
} pub fn update(ev: zz.Event) void { switch (ev) { .ModeUpdate => |mode_info| mode = mode_info.mode, else => {}, }
} pub fn render(rows: i32, cols: i32) void { _ = rows; _ = cols; if (mode) |m| { var out = std.io.getStdOut(); var writer = out.writer(); writer.writeAll(@tagName(m)) catch {}; }
} Now, all that's left is to build with gyro build -Drelease-fast (you should do a release build, since debug builds tend to be buggy sometimes) and run zellij with our layout file: zellij --layout-path plugin.yaml.

